import styles from "./UserCard.module.scss"
import Input from "./ui/Input"
import Spacer from "./ui/Spacer"

// TODO recreate
interface Props {
  image?: string
  handle?: string
  wpm?: number
  wordsTyped?: number
  accuracy?: number

  editable?: boolean
  loading?: boolean
}

export default function UserCard(props: Props) {
  // const image = props.image ?? generateImage()

  const isHandleLoading = props.loading && !props.handle

  return (
    <div className={styles.base} data-loading={true}>
      <div data-inner>
        <div data-profile-image>
          <img src={props.image} alt={"profile picture"} />
        </div>
        <div data-handle>
          @
          <div
            data-handle-input
            data-loading={isHandleLoading}
          >
            {props.handle}
          </div>
        </div>

        <Spacer.Flex flex="1"/>

        <div data-stat>
          <p data-stat-title>words typed</p>
          <p data-stat-value>{props.wordsTyped}</p>
        </div>
      </div>
    </div>
  )
}

function generateImage() {
  return `
  data:image/jpeg;base64,
  `
}